function Winner(props) {
    return (
        <tr className={"winner-tr"}>
            <div>{props.winner.address}</div>
            <div>{props.winner.fee}</div>
            <div>{props.winner.entrance_date}</div>
            <div>{props.winner.won}</div>
            <div>{props.winner.date}</div>
        </tr>
    );
}

export default Winner;
